window.bookSummaryJSON = "<p><b>A woman trapped with her crush…</b></p> <p>When I agreed to go to an escape room with friends, I didn't expect everyone to bail and leave me locked in a room with the hottest, most unattainable person I've ever met—my brother's minotaur best friend. Tension from the tight quarters and frustrating puzzles leads to heated confessions and the wildest night of my life.</p> <p>He says he wants more. He wants to be my daddy. It's everything I've dreamed of, but how am I supposed to manage the reality of being with him when I'm falling apart at the seams and plagued by self-doubt?</p> <p><b>A minotaur who won't let his chance at love escape…</b></p> <p>Who knew one night in an escape room would change everything? Finding out my attraction to Ariana wasn't one-sided woke up the dominant beast inside that me demands I take care of her, cherish her, and claim her as mine.</p> <p>Now, all I have to do is figure out how to convince a woman who's only ever been able to depend on herself to trust me enough to accept everything I'm desperate to give her. Oh, and not get my throat ripped out by my best friend for hooking up with his little sister.</p> <p>Escaping the Friendzone<i> is a cozy, high-heat monster romance featuring a burned-out, plus-size woman and a doting daddy dom minotaur.</i></p> <p><i>This is a standalone story set in the Monsters of Moonvale universe.</i></p>"; 
